import './App.css';
import Header from './Header';
import Post from './Post';
import { Routes, Route } from 'react-router-dom'


function App() {
  return (
    <Routes>
      <Route index element={
        <main>
          <Header />
          <Post />
          <Post />
          <Post />
        </main>
      }> 
      </Route>

      <Route path={'/login'} element={<div>Login</div>}></Route>

    </Routes>

  );
}

export default App;
